// Import necessary components from React Router
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Navbar from './components/Navbar';
import FilterSection from './components/Filtersection';
import HouseListing from './components/Houselisting';
import Footer from './components/Footer';
import Favorites from './components/Favorites';  // Import Favorites page
import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        {/* Navbar is always present */}
        <Navbar />

        {/* Switch for different routes */}
        <Switch>
          {/* Home Page with House Listing */}
          <Route path="/" exact>
            <FilterSection />  {/* FilterSection is shown only on the home page */}
            <HouseListing />
          </Route>

          {/* Favorites Page */}
          <Route path="/favorites">
            <Favorites />  {/* Favorites component */}
          </Route>
        </Switch>

        {/* Footer is always present */}
        <Footer />
      </div>
    </Router>
  );
}

export default App;
